import React, {Component} from 'react';
import Title from "../Title/Title";
import './Main.css'

class Main extends Component {
    render() {
        return (
            <div className="main">
                <div className="container">
                <Title text="Психотерапевт Марія Шугай"/>
                </div>
            </div>
        );
    }
}

export default Main;
